import classes from "./UserList.module.css";

const UserList = (props) => {
  return (
    <div >
      <ul >
        <li className={classes.users}>
          {props.userInputs.UserName} , {props.userInputs.Age} Years old
        </li>
      </ul>
    </div>
  );
};
export default UserList;
